import React, { useState } from "react";

const indianStates = [
  "Andhra Pradesh", "Arunachal Pradesh", "Assam", "Bihar", "Chhattisgarh",
  "Delhi", "Goa", "Gujarat", "Haryana", "Himachal Pradesh", "Jharkhand",
  "Karnataka", "Kerala", "Madhya Pradesh", "Maharashtra", "Manipur",
  "Meghalaya", "Mizoram", "Nagaland", "Odisha", "Puducherry", "Punjab",
  "Rajasthan", "Sikkim", "Tamil Nadu", "Telangana", "Tripura",
  "Uttar Pradesh", "Uttarakhand", "West Bengal"
];

const categories = ["GEN", "EWS", "OBC-NCL", "SC", "ST", "PWD"];
const genders = ["gender-neutral", "female"];

const RankForm = () => {
  const [formData, setFormData] = useState({
    state: "",
    gender: "",
    category: "",
    rankInCategory: "",
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const response = await fetch("http://localhost:5000/api/ranks", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(formData),
    });

    if (response.ok) {
      alert("Rank submitted successfully!");
      setFormData({ state: "", gender: "", category: "", rankInCategory: "" });
    } else {
      alert("Error submitting rank");
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      {/* State Dropdown */}
      <label>State:</label>
      <select name="state" value={formData.state} onChange={handleChange} required>
        <option value="">Select State</option>
        {indianStates.map((state) => (
          <option key={state} value={state}>{state}</option>
        ))}
      </select>

      {/* Gender Dropdown */}
      <label>Gender:</label>
      <select name="gender" value={formData.gender} onChange={handleChange} required>
        <option value="">Select Gender</option>
        {genders.map((gender) => (
          <option key={gender} value={gender}>{gender}</option>
        ))}
      </select>

      {/* Category Dropdown */}
      <label>Category:</label>
      <select name="category" value={formData.category} onChange={handleChange} required>
        <option value="">Select Category</option>
        {categories.map((category) => (
          <option key={category} value={category}>{category}</option>
        ))}
      </select>

      {/* Rank Input */}
      <label>Rank in Your Category:</label>
      <input
        type="number"
        name="rankInCategory"
        value={formData.rankInCategory}
        onChange={handleChange}
        required
      />

      <button type="submit">Submit</button>
    </form>
  );
};

export default RankForm;
